import { useState } from 'react';

export default () => {
  const [value, setValue] = useState('');
  const [value1,setValue1] = useState('');
  return {
    value,value1,
    onChange: event => {
      setValue(event.target.value);
    },
    onChange1: event => {
        setValue1(event.target.value);
    },
    reset1: () => setValue1(''),
    reset: () => setValue('')
  };
};
